import React, { Component } from "react";

class File extends Component {
  hello(users) {
    return <h3>hello   {users}</h3>;
  }

  render() {
    const names = ["ayman", "ahmed"];
    const h = this.hello(users);

    const users = names.map(function (e) {
      return (
        <h1>
          {h} {e}
        </h1>
      );
    });

    return users;
  }
}

export default File;
